var uiConfig={signInSuccessUrl:"admin",signInOptions:[firebase.auth.EmailAuthProvider.PROVIDER_ID,firebase.auth.GoogleAuthProvider.PROVIDER_ID,firebase.auth.FacebookAuthProvider.PROVIDER_ID,firebase.auth.GithubAuthProvider.PROVIDER_ID]},ui=new firebaseui.auth.AuthUI(firebase.auth());ui.start("#firebaseui-auth-container",uiConfig);
initApp=function(){firebase.auth().onAuthStateChanged(function(e){var a=document.getElementById("firebaseui-auth-container"),b=document.getElementById("sign-in-status"),c=document.getElementById("admin-button"),d=document.getElementById("sign-out");e?(a.style.display="none",c.style.display="block",b.textContent="You're already signed in!",d.onclick=function(){firebase.auth().signOut()}):(a.style.display="block",c.style.display="none",b.textContent="Sign In",d.onclick=null)})};
window.addEventListener("load",function(){initApp()});